class AdminsginupComponent {
    constructor(http, service, snack) {
        this.http = http;
        this.service = service;
        this.snack = snack;
        this.name = '';
        this.url = 'http://localhost:3000/details';
        this.loading = false;
        this.loading = true;
        this.service.getedetails().subscribe((res) => {
            console.log(res);
            console.log(this.data);
            this.data = res.map(e => {
                this.loading = false;
                return {
                    id: e.payload.doc.id,
                    name: e.payload.doc.data()['name'],
                    phone: e.payload.doc.data()['phone'],
                    pass: e.payload.doc.data()['pass'],
                    email: e.payload.doc.data()['email'],
                    cpass: e.payload.doc.data()['cpass'],
                };
            });
        });
    }
    // msg = new user('','','','','','');
    onDelete(obj) {
        this.service.deletedetails(obj.id);
    }
    onCreat(obj) {
        this.service.createdetails(obj.value).then(res => {
            this.phone = '';
            this.emaill = '';
            this.password = '';
            this.cpassword = '';
            this.id = Math.round(Math.random() * 1000000000);
            this.name = '';
            this.openSnack('Your data has been saved', 'OK');
        }).catch(error => {
            console.log(error);
        });
    }
    openSnack(message, action) {
        let snak = this.snack.open(message, action, {
            duration: 5000,
        });
        snak.afterDismissed().subscribe(() => {
            console.log('hi');
        });
    }
    openSnackBar(message, action, obj) {
        let snak = this.snack.open(message, action, {
            duration: 5000,
        });
        snak.afterDismissed().subscribe(() => {
            console.log('hi');
        });
        snak.onAction().subscribe(() => {
            this.onDelete(obj);
        });
    }
    ngOnInit() { }
}
