class CostoComponent {
    constructor(http, service, snack) {
        this.http = http;
        this.service = service;
        this.snack = snack;
        this.url = 'http://localhost:3000/coustomer';
        this.loading = false;
        this.loading = true;
        this.service.getcoustomer().subscribe((res) => {
            console.log(res);
            console.log(this.data);
            this.data = res.map(e => {
                this.loading = false;
                return {
                    id: e.payload.doc.id,
                    name: e.payload.doc.data()['name'],
                    phone: e.payload.doc.data()['phone'],
                    pass: e.payload.doc.data()['pass'],
                    email: e.payload.doc.data()['email'],
                    cpass: e.payload.doc.data()['cpass'],
                };
            });
        });
    }
    ngOnInit() {
    }
    onDelete(obj) {
        this.service.deletecoustomer(obj.id);
    }
    openSnackBar(message, action, obj) {
        let snak = this.snack.open(message, action, {
            duration: 5000,
        });
        snak.afterDismissed().subscribe(() => {
            console.log('hi');
        });
        snak.onAction().subscribe(() => {
            this.onDelete(obj);
        });
    }
}
